import React from "react";
import { BubbleChart, RadarChart } from "react-chartjs-2";



const radarChartData = {
  labels: ["Song 1", "Song 2", "Song 3", "Song 4", "Song 5", "Song 6", "Song 7", "Song 8", "Song 9", "Song 10"],
  datasets: [
    {
      label: "Popularity",
      backgroundColor: "rgba(29, 185, 84, 0.2)",
      borderColor: "#1DB954",
      pointBackgroundColor: "#1DB954",
      pointBorderColor: "#fff",
      pointHoverBackgroundColor: "#fff",
      pointHoverBorderColor: "#1DB954",
      data: [65, 59, 80, 81, 56, 55, 40, 20, 30, 50],
    },
  ],
};



const RadarChartComponent = () => {
  return <RadarChart data={radarChartData} />;
};

export default RadarChartComponent;
